import styles from "../styles/Pantryyumyums.module.css";
import pantryyumyums from "../assets/pantryyumyums.png";

function Cbc() {
    return (
        <section className={styles.pantryYY}>
            <h1>Pantry Yum Yums</h1>
            <h4>React Website</h4>
            <p>The Canadian Broadcasting Corporation is a broadcasting network in
                Canada. They offer programming and news throughout the country. Their
                mission is to inform, to reveal, to contribute to the understanding of
                issues of public interest.
            </p>

            <a href="https://fervent-northcutt-df7533.netlify.app/">
                Check out Pantry Yum Yums Live!
            </a>
            <img
                src={pantryyumyums}
                className={styles.pantryYYImg}
                alt="CBC Player"
            />
        </section>
    );
}

export default Cbc;
